import React, { Component } from 'react';
import { Dropdown, Menu } from 'semantic-ui-react'
class ComposeSalad extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        const inventory = this.props.inventory;
        let foundations = Object.keys(inventory).filter(
            name => inventory[name].foundation
        );
        let protein = Object.keys(inventory).filter(
            name1 => inventory[name1].protein
        );
        let extra = Object.keys(inventory).filter(
            name2 => inventory[name2].extra
        );
        let dressing = Object.keys(inventory).filter(
            name3 => inventory[name3].dressing
        );
        return (
            <div className="container">
                <h1>V채lj bas</h1>
                <ul>
                    {foundations.map(name => <li key={name}>{name}</li>)}
                </ul>
                <h2>V채lj protein</h2>
                <ul>
                    {protein.map(name1 => <li key={name1}>{name1}</li>)}
                </ul>
                <h3>V채lj extra</h3>
                <ul>
                    {extra.map(name2 => <li key={name2}>{name2}</li>)}
                </ul>
                <h4>V채lj dressing</h4>
                <ul>
                    {dressing.map(name3 => <li key={name3}>{name3}</li>)}
                </ul>
                <DropdownButton id="dropdown-basic-button" title="Dropdown button">
                <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
                <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
                <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
                </DropdownButton>
            </div>
        );
    }
}
export default ComposeSalad;
